import React from 'react';
import styled from 'styled-components';

import { Map, GoogleApiWrapper } from 'google-maps-react';

function Confirmation(props) {
    const mapStyles = {
        width: '100%',
        height: '100%'
    }
    return (
        <Container>
            <ConfirmationTop>
                <img src="/assets/FoodDeliveryApp.png" alt="Food Delivery App Logo"/>
                <Main>
                    <h1>Thank You For Your Order</h1>
                    <h3>Order Confirmation #001</h3>
                    <Hero>
                        <h2>Back To Order Page</h2>
                        <p>|</p>
                        <h2>Log Out</h2>
                    </Hero>
                    <p>Use the map to see tracking information on your delivery driver!</p>
                </Main>
                <ContactH2>Contact Us</ContactH2>
            </ConfirmationTop>
            <ConfirmationBottom>
                <Map
                    google={props.google}
                    zoom={15}
                    style={mapStyles}
                    initialCenter={
                      {
                        lat: 40.014,
                        lng: -105.269
                      }
                    }
                ></Map>
            </ConfirmationBottom>
        </Container>
    )
}

const Container = styled.div`
    width: 100vw;
    height: 100vh;
`

const ConfirmationTop = styled.div`
    display: flex;  
    width: 100%;
    margin: 20px 50px;
    height: 50vh;

    img {
        width: 150px;
        height: 150px;
    }
`

const Main = styled.div`
    display: flex;
    flex-direction: column;
` 
const Hero = styled.div`
    display: flex;
`

const ContactH2 = styled.h2`

`

const ConfirmationBottom = styled.div`
    width: 100%;
    height: 50vh;
`

export default GoogleApiWrapper({
    apiKey: 'AIzaSyDG2yQUqLUTXWRPyDceJqntNldd_v69-Aw'
  })(Confirmation);
